// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NFTMarket is ERC721Holder, Ownable {
    struct NFT {
        address tokenAddress;
        uint256 tokenId;
        uint256 price;
        bool listed;
    }

    mapping(address => NFT[]) public sellerNFTs;

    receive() external payable {}

     constructor() Ownable(msg.sender) {

    }

    function listNFT(address _tokenAddress, uint256 _tokenId, uint256 _price) public {
        IERC721 nftToken = IERC721(_tokenAddress);
        require(nftToken.ownerOf(_tokenId) == msg.sender, "Not the owner of the NFT");
        require(_price > 0, "Price must be greater than zero");

        sellerNFTs[msg.sender].push(NFT({
            tokenAddress: _tokenAddress,
            tokenId: _tokenId,
            price: _price,
            listed: true
        }));
    }

    function getSellerListedNFTs(address _seller) public view returns (NFT[] memory) {
        return sellerNFTs[_seller];
    }

    function removeNFTFromMarket(uint256 _index, address _owner) public payable {
        require(_index < sellerNFTs[_owner].length, "NFT does not exist");

        NFT storage nft = sellerNFTs[_owner][_index];
        require(nft.listed, "NFT not listed for sale");

        nft.listed = false;
    }

    function withdraw() public onlyOwner {
        uint256 amount = address(this).balance;
        require(amount > 0, "There are no coins to withdraw");

        (bool success, ) = owner().call{value: amount}("");
        require(success, "Failed to send");
    }
}
